import { firebaseDatabase } from '../utils/firebaseUtils';

const data = firebaseDatabase.ref();

export default class System extends Component {
    async renderData() {
        var data
        await firebaseDatabase.ref().on('value', snap => {
            data = snap.val();
        });
    }

    render() {
        return (
            <div>
                {console.log("-----", data)}
                <span>Cafeteira</span>
            </div>
        );
    }
};
